import React from 'react';


class WizardField extends React.Component{

    render(){
        return(
            <div>
                <label>
                    {this.props.label}:
                </label>
                <input 
                    type={this.props.type}
                    value={this.state.name} 
                    onChange={this.props.handleChange}
                />
            </div>
            );
    }
}

export default WizardField;
